import React from 'react';

import {
  HeaderContainer
} from './HeaderStyles';

const Header = () => (
  <HeaderContainer>
    <h1>What, son?</h1>
    <div>
      <ul>
        <li>Toggle microphone to enable recording and real time translation.</li>
        <li>Choose languages</li>
      </ul>
    </div>
  </HeaderContainer>
)

export default Header;
